<script>
	import LXLogo from '@/static/LX.png';
	import HBLogo from '@/static/HB.jpg';
	import SDLogo from '@/static/shandong/logo.jpg';

	import {getNotice,serviceList} from '@/api/userInfo.js';
import moment from '@/common/moment';
	export default {
		props: {},
		components: {
		},
		filters: {
			time(val) {
				return moment(val).format('YYYY年MM月DD日');
			},
		},
		data() {
			return {
				NowLogo: null,
				messageData: this.$mStore.getters.messageData,
				nodeDetail : {},
				serviceListArr: [],
				current: 0,
				mode: 'round',
				messageData: this.$mStore.getters.messageData
			};
		},
		created() {

		},
		onLoad() {
			let orgLogo =  this.$mStore.getters.messageData.orgLogo;
			if(orgLogo == "LX") {
				this.NowLogo = LXLogo;
			} else if(orgLogo == "SD") {
				this.NowLogo = SDLogo;
			} else if(orgLogo == "HB") {
				this.NowLogo = HBLogo;
			} else {
				this.NowLogo = LXLogo;
			}
			this.getNoticeFn();
		},
		methods: {
			change(e) {
			   this.current = e.detail.current;
			},
			getNoticeFn() {
				this.$http
					.post(`${getNotice}`,{},{params:{orgId: this.$mStore.getters.orgId}})
					.then(async r => {
						this.nodeDetail = r.data.data[0];
					}).catch(err => {

					});
					this.$http
						.post(`${serviceList}`,{},{params:{orgId: this.$mStore.getters.orgId}})
						.then(async r => {
							r.data.forEach((item)=>{
								try{
										item.emails = JSON.parse(item.emails);
									} catch (e){
										item.emails = [{"電郵":""}];
									}
							});
							this.serviceListArr = r.data;
							this.$forceUpdate();
						});
			}
		}
	};
</script>
